jobInfo.postDescription:
岗位职责:
1.采用java技术架构产品,并参与产品的技术路线确定,产品规划、需求分析等;
2.负责产品的代码的实现、调试与维护工作,并及时支持响应客户的各类技术问题;
3.负责根据客户需求对产品进行二次开发和持续迭代;
4.熟练使用若依等相关技术框架，完成二次项目开发，并能独立完成项目;
5.协助编制相关的各类技术文档,并对所属产品发展提供建议和策略;
6.能根据功能、需求独立创建mysql数据库表格字段及熟练掌握操作数据库;
7.辅助其他模块进行技术实现集成对接和联调。
任职要求:
1.计算机或者相关专业，良好的逻辑分析能力及编程逻辑能力;
2.良好的问题理解、处理能力,能够理解以及处理复杂逻辑;
3.具备较强的自学能力,团队精神以及适合在高压力环境下工作;
4.java、若依开发经验3年左右,了解VUE相关的知识,精通springboot编程,熟悉多线程编程,熟悉java主流框架和架构思想,熟练掌握若依框架、ajax等;
5.具有一定的文档编写能力等。
